import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import RootApp from "./RootApp";  // เปลี่ยนจาก App เป็น RootApp

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <RootApp />
  </React.StrictMode>
);
